import React from "react";
import { useSelector } from "react-redux";

export const Basket=()=> { 

    const basket=useSelector(state=>state.basket)

    return( 
        <div>
            {basket.items.map((p)=> 
           <> 
           <p> Товар:`${p.title}`</p>
           <p> Стоимость:`${p.price}`</p>
           
           </>   
           
           
           )}
           <h2>
            Итого:`${basket.total}`рублей 
           </h2>

        </div>
    )
}
